INSERT INTO `mod_executed_notifications` (`iExecutedNotificationId`, `iSysRecDeleted`, `iEntityId`, `iGroupId`, `eEntityType`, `vReceiver`, `eNotificationType`, `vRedirectLink`, `vSubject`, `tContent`, `tParams`, `tError`, `eStatus`, `dtSendDateTime`) VALUES
	(1, 0, 0, 0, 'General', 'chinmaymrk@theappineers.com', 'EmailNotify', NULL, 'Email Confirmation', '<p></p>\n<p></p>\n<table cellpadding="0" cellspacing="0" width="100%" align="center">\n<tbody>\n<tr>\n<td style="background: url(\'http://18.211.58.235/Appineers_V3_Web/public/upload/settings_files/mainbg-20191015060707819935.png\') no-repeat top center;">\n<table width="720" cellpadding="0" cellspacing="0" border="0" align="center" class="main-table" style="background: url(\'http://18.211.58.235/Appineers_V3_Web/public/upload/settings_files/shadowbg-20190925070927142521.png\') repeat-y; font-family: Georgia, \'Times New Roman\', Times, serif; font-size: 18px; line-height: normal; padding: 33px 0 43px 0; margin-top: 40px;">\n<tbody>\n<tr style="height: 2px;">\n<td style="height: 2px;">\n<table width="700" cellpadding="0" cellspacing="0" border="0" align="center"></table>\n</td>\n</tr>\n<tr style="height: 25px;">\n<td style="font-size: 20px; color: #242cca; text-align: center; padding-bottom: 13px; position: relative; height: 25px;" align="center"><span style="font-family: helvetica, arial, sans-serif;"><img src="http://18.211.58.235/Appineers_V3_Web/public/upload/settings_files/Group_10881-5f757ae2bfbaf.jpg" /></span></td>\n</tr>\n<tr style="height: 253px;">\n<td valign="top" style="height: 253px;">\n<table cellpadding="0" cellspacing="0" border="0" width="680" align="center">\n<tbody>\n<tr style="height: 105px;">\n<td style="height: 105px;">\n<p style="color: #222222; font-size: 25px; text-align: center; font-style: normal; font-family: Georgia, \'Times New Roman\', Times, serif; margin: 20px 0 5px 0; line-height: 40px;"><span style="font-family: helvetica, arial, sans-serif;">Congratulations for being a part of</span><br /><strong><span style="font-family: helvetica, arial, sans-serif; color: #3366ff;">The Appineers</span></strong></p>\n</td>\n</tr>\n<tr style="height: 142px;">\n<td style="padding: 0px 40px; height: 142px;">\n<p style="margin: 10px 0 20px 0; line-height: 20px;"><span style="font-family: helvetica, arial, sans-serif; font-size: 12pt;">Hello  ,</span></p>\n<p style="margin: 20px 0 0 0; line-height: 28px;"><span style="font-family: helvetica, arial, sans-serif; font-size: 12pt;">Welcome to <strong><span style="color: #3366ff;">The Appineers</span></strong>.&nbsp;</span><span style="font-family: helvetica, arial, sans-serif; font-size: 12pt;">Please click on following&nbsp;button to confirm your account:</span></p>\n<p style="font-size: 16px; color: #282e3f; padding: 0; margin: 10px 0 0; line-height: 22px;"><span style="font-family: helvetica, arial, sans-serif; font-size: 12pt;"><a style="height: 25px; background: #38BE74; padding: 8px 10px; text-decoration: none; color: #fff; border-radius: 5px;" href="http://18.211.58.235/Appineers_V3_Web/confirmation?code=Y2hpbm1heW1ya0B0aGVhcHBpbmVlcnMuY29tJjE2MjI0NDQ1OTM=">Activate Your Account</a></span></p>\n</td>\n</tr>\n<tr style="height: 18px;">\n<td style="text-align: left; line-height: 18px; font-size: 14px; padding-left: 40px; height: 18px;">\n<p></p>\n</td>\n</tr>\n<tr style="height: 18px;">\n<td style="text-align: left; line-height: 18px; font-size: 14px; padding-left: 40px; height: 18px;">\n<p>Thanks &amp; Regards,<br /><span style="font-family: helvetica, arial, sans-serif;"></span></p>\n</td>\n</tr>\n<tr style="height: 20px;">\n<td style="font-size: 16px; color: #000000; text-align: left; padding-left: 40px; height: 20px;"><span style="color: #333399; font-family: helvetica, arial, sans-serif;"><strong><span style="color: #3366ff;">The Appineers</span></strong></span></td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr style="height: 5px;">\n<td style="height: 5px;">\n<p><span style="font-family: helvetica, arial, sans-serif;">&nbsp;</span></p>\n</td>\n</tr>\n<tr style="height: 19px;">\n<td style="font-size: 16px; color: #000000; text-align: left; padding-left: 40px; height: 19px;"></td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n</tbody>\n</table>', '{"from_name"