ader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</p>', 'Privacy policy', 'Privacy policy', 'Privacy policy', '2013-06-04 00:00:00', 'Active', 0, '7.0'),
	(36, 'Test static page title', 'Test static page code', 'Test static page url', '<p>Test static page Content&nbsp;<br /><br />This is text box and words count is displaying at bottom of the box&nbsp;</p>\n<p></p>', 'Test static page  meta\n\ntitle\n', 'Test static page meta keybword', 'Test static page meta desc', '0000-00-00 00:00:00', 'Active', 0, 'Test static page version 1.0'),
	(37, 'Eula Policy', 'eula', '', '<h2 id="What_Is_An_End_User_License_Agreement">What is an End User License Agreement?</h2>\n<p>An EULA is a specific<span>&nbsp;</span><strong>contract</strong><span>&nbsp;</span>between the software creator, developer, or publisher, and the individual end user who purchases the software. The contract gives the user a right to<span>&nbsp;</span><strong>use</strong><span>&nbsp;</span>a copy of the app or software in a specific way, subject to clear<span>&nbsp;</span><strong>conditions</strong>.</p>\n<p>The end user can\'t download or install the software copy<span>&nbsp;</span><strong>until they agree</strong><span>&nbsp;</span>to these conditions of use. In other words, think of an EULA like a rental agreement. The<span>&nbsp;</span><strong>user pays to use the software</strong>, but the developer<span>&nbsp;</span><strong>still owns it</strong>.</p>\n<p>This is important because there\'s a<span>&nbsp;</span><strong>common misconception</strong><span>&nbsp;</span>that end users "own" their copy of your app. People often assume that when they buy something, it belongs to them. However, all the end user has is a<span>&nbsp;</span><strong>functioning copy</strong><span>&nbsp;</span>of your software - not rights to the software itself.</p>\n<h2 id="Who_Needs_An_End_User_License_Agreement">Who Needs an End User License Agreement?</h2>\n<p>Essentially, if you make your technology available for public use, then you have a need for an EULA.</p>\n<p>So, for example, if you\'re a<span>&nbsp;</span><strong>video game company</strong><span>&nbsp;</span>that supports online gaming, or you\'re a<span>&nbsp;</span><strong>developer</strong><span>&nbsp;</span>and you\'ve made an app available on the Apple App Store, you should have an EULA.</p>', '', '', '', '0000-00-00 00:00:00', 'Active', 0, '1.0.1'),
