INSERT INTO `mod_release_note_details` (`iReleaseNoteDetailsId`, `iSysRecDeleted`, `iReleaseNotesId`, `vTitle`, `tDescription`, `eVersionStatus`, `dDateAdded`, `iAddedBy`, `dDateUpdated`, `iUpdatedBy`) VALUES
	(1, 0, 1, 'Improments', '<ul>\n<li>Removed $is_dst parameter from mktime() and gmmktime().</li>\n<li>Removed date.timezone warning (https://wiki.php.net/rfc/date.timezone_warning_removal).</li>\n<li>Added "v" DateTime format modifier to get the 3-digit version of fraction of seconds.</li>\n<li>Implemented FR<span>&nbsp;</span>#69089<span>&nbsp;</span>(Added DateTime::RFC3339_EXTENDED to output in RFC3339 Extended format which includes fraction of seconds).</li>\n</ul>', 'Improvement', '2018-11-02 00:00:00', 1, '2018-11-02 00:00:00', 0),
	(2, 0, 1, 'Core', '<ul>\n<li>Fixed bug<span>&nbsp;</span>#70662<span>&nbsp;</span>(Duplicate array key via undefined index error handler).</li>\n<li>Fixed bug<span>&nbsp;</span>#70258<span>&nbsp;</span>(Segfault if do_resize fails to allocated memory).</li>\n<li>Fixed bug<span>&nbsp;</span>#70159<span>&nbsp;</span>(__CLASS__ is lost in closures).</li>\n<li>Fixed bug<span>&nbsp;</span>#69849<span>&nbsp;</span>(Broken output of apache_request_headers).</li>\n<li>Fixed bug<span>&nbsp;</span>#69551<span>&nbsp;</span>(parse_ini_file() and parse_ini_string() segmentation fault).</li>\n</ul>', 'Bug Fixes', '2018-11-02 00:00:00', 1, '2018-11-02 00:00:00', 0),
	(3, 0, 2, 'OpenSSL', '<ul>\n<li>Bumped a minimal version to 1.0.1.</li>\n<li>Dropped support for SSL2.</li>\n<li>Implemented FR<span>&nbsp;</span>#61204<span>&nbsp;</span>(Add elliptic curve support for OpenSSL).</li>\n<li>Implemented FR<span>&nbsp;</span>#67304<span>&nbsp;</span>(Added AEAD support [CCM and GCM modes] to openssl_encrypt and openssl_decrypt).</li>\n<li>Implemented error storing to the global queue and cleaning up the OpenSSL error queue (resolves bugs #68276 and #69882).</li>\n</ul>', 'New Feature', '2018-11-02 00:00:00', 1, '2018-11-02 00:00:00', 0),
	(4, 0, 2, 'Upgrade notes', '<ul>\n<li>Enable per-module logging in Apache 2.4+.</li>\n<li>Implement support for handling HTTP/2 Server Push.</li>\n<li>Disabled PHP call tracing by default (it makes significant overhead). This may be enabled again using envirionment variable USE_ZEND_DTRACE=1.</li>\n<li>Added SHA3 fixed mode algorithms (224, 256, 384, and 512 bit).</li>\n<li>Added SHA512/256 and SHA512/224 algorithms.</li>\n</ul>', 'Improvement', '2018-11-02 00:00:00', 1, '2018-11-02 00:00:00', 0),
	(5, 0, 3, 'ZIP', '<ul>\n<li>Add support for encrypted archives.</li>\n<li>Use of bundled libzip is deprecated, --with-libzip option is recommended</li>\n<li>ZipArchive implements countable, added ZipArchive::count() method.</li>\n<li>Fix segfault in php_stream_context_get_option call.</li>\n</ul>', 'New Feature', '2018-11-02 00:00:00', 1, '2018-11-02 00:00:00', 0),
	(6, 0, 3, 'Mbstring', '<ul>\n<li>Implemented FR<span>&nbsp;</span>#66024<span>&nbsp;</span>(mb_chr() and mb_ord()).</li>\n<li>Implemented FR<span>&nbsp;</span>#65081<span>&nbsp;</span>(mb_scrub()).</li>\n<li>Implemented FR<span>&nbsp;</span>#69086<span>&nbsp;</span>(enhancement for mb_convert_encoding() that handles multibyte replacement char nicely).</li>\n<li>Added array input support to mb_convert_encoding().</li>\n<li>Added array input support to mb_check_encoding().</li>\n</ul>', 'Improvement', '2018-11-02 00:00:00', 1, '2018-11-02 00:00:00', 0),
	(7, 0, 4, 'GMP', '<ul>\n<li>Export internal structures and accessor helpers for GMP object.</li>\n<li>Added gmp_binomial(n, k).</li>\n<li>Added gmp_lcm(a, b).</li>\n<li>Added gmp_perfect_power(a).</li>\n<li>Added gmp_kronecker(a, b).</li>\n</ul>', 'New Feature', '2018-11-05 00:00:00', 1, '2018-11-05 00:00:00', 0),
	(8, 0, 1, 'Highlights', '<ul>\n<li>Refactor MIME type handling to use a hash table instead of linear search.</li>\n<li>Update the MIME type list from the one shipped by Apache HTTPD.</li>\n<li>Added support for SEARCH WebDav method.</li>\n<li><span>LiteSpeed:</span>\n<ul>\n<li>Updated LiteSpeed SAPI code from V5.5 to V6.6.</li>\n</ul>\n</li>\n<li><span>Mcrypt:</span>\n<ul>\n<li>Removed mcrypt_generic_end() alias.</li>\n<li>Removed mcrypt_ecb(), mcrypt_cbc(), mcrypt_cfb(), mcrypt_ofb().</li>\n</ul>\n</li>\n</ul>', 'New Feature', '2019-04-22 00:00:00', 1, '2019-04-22 00:00:00', 0),
	(9, 0, 2, 'Core', '<ul>\n<li>Fixed bug<span>&nbsp;</span>#72681<span>&nbsp;</span>(PHP Session Data Injection Vulnerability).</li>\n<li>Fixed bug<span>&nbsp;</span>#71818<span>&nbsp;</span>(Memory leak when array altered in destructor).</li>\n<li>Fixed bug<span>&nbsp;</span>#69489<span>&nbsp;</span>(tempnam() should raise notice if falling back to temp dir).</li>\n<li>Fixed bug<span>&nbsp;</span>#71539<span>&nbsp;</span>(Memory error on $arr[$a] =&amp; $arr[$b] if RHS rehashes).</li>\n</ul>', 'Bug Fixes', '2019-04-22 00:00:00', 1, '2019-04-22 00:00:00', 0),
	(10, 0, 3, 'Core', '<ul>\n<li>Implemented FR<span>&nbsp;</span>#74963<span>&nbsp;</span>(Improved error message on fetching property of non-object).</li>\n<li>Fixed bug<span>&nbsp;</span>#75142<span>&nbsp;</span>(buildcheck.sh check for autoconf version needs to be updated for v2.64).</li>\n<li>Fixed bug<span>&nbsp;</span>#74878<span>&nbsp;</span>(Data race in ZTS builds).</li>\n<li>Fixed bug<span>&nbsp;</span>#75515<span>&nbsp;</span>("stream_copy_to_stream" doesn\'t stream anymore).</li>\n<li>Fixed bug<span>&nbsp;</span>#61970<span>&nbsp;</span>(Restraining __construct() access level in subclass gives a fatal error).</li>\n</ul>', 'Bug Fixes', '2019-04-22 00:00:00', 1, '2019-04-22 00:00:00', 0),
	(11, 0, 4, 'BCMath', '<ul>\n<li>Implemented FR<span>&nbsp;</span>#67855<span>&nbsp;</span>(No way to get current scale in use).</li>\n<li>Fixed bug<span>&nbsp;</span>#66364<span>&nbsp;</span>(BCMath bcmul ignores scale parameter).</li>\n<li>Fixed bug<span>&nbsp;</span>#75164<span>&nbsp;</span>(split_bc_num() is pointless).</li>\n<li>Fixed bug<span>&nbsp;</span>#75169<span>&nbsp;</span>(BCMath errors/warnings bypass PHP\'s error handling).</li>\n</ul>', 'Improvement', '2019-04-22 00:00:00', 1, '2019-04-22 00:00:00', 0),
	(12, 0, 4, 'Core', '<ul>\n<li>Fixed bug<span>&nbsp;</span>#53033<span>&nbsp;</span>(Mathematical operations convert objects to integers).</li>\n<li>Fixed bug<span>&nbsp;</span>#73108<span>&nbsp;</span>(Internal class cast handler uses integer instead of float).</li>\n<li>Fixed bug<span>&nbsp;</span>#75765<span>&nbsp;</span>(Fatal error instead of Error exception when base class is not found).</li>\n<li>Fixed bug<span>&nbsp;</span>#76198<span>&nbsp;</span>(Wording: "iterable" is not a scalar type).</li>\n<li>Fixed bug<span>&nbsp;</span>#76137<span>&nbsp;</span>(config.guess/config.sub do not recognize RISC-V).</li>\n</ul>', 'Bug Fixes', '2019-04-22 00:00:00', 1, '2019-04-22 00:00:00', 0);
