	(6, 'ADMIN_RESET_PASSWORD', 'Reset Password - Admin', 'Administrator', 'cit.email003@gmail.com', '', '', 'Change your password on #SYSTEM.COMPANY_NAME#', '<p></p>\n<p></p>\n<table cellpadding="0" cellspacing="0" width="100%" align="center">\n<tbody>\n<tr>\n<td style="background: url(\'#SYSTEM.site_url#public/upload/settings_files/#SYSTEM.EMAIL_MAIN_BG_IMAGE#\') no-repeat top center;">\n<table width="720" cellpadding="0" cellspacing="0" border="0" align="center" class="main-table" style="background: url(\'#SYSTEM.site_url#public/upload/settings_files/#SYSTEM.EMAIL_SHADOW_BG_IMAGE#\') repeat-y; font-family: Georgia, \'Times New Roman\', Times, serif; font-size: 18px; line-height: normal; padding: 33px 0 43px 0; margin-top: 40px;">\n<tbody>\n<tr>\n<td>\n<table width="700" cellpadding="0" cellspacing="0" border="0" align="center"></table>\n</td>\n</tr>\n<tr>\n<td style="font-size: 20px; color: #242cca; text-align: center; padding-bottom: 13px; position: relative;" align="center"><img src="#SYSTEM.site_url#public/upload/settings_files/#SYSTEM.EMAIL_LOGO#" /></td>\n</tr>\n<tr>\n<td valign="top">\n<table cellpadding="0" cellspacing="0" border="0" width="680" align="center">\n<tbody>\n<tr style="height: 188px;">\n<td style="padding: 0px 40px; height: 188px;">\n<p style="margin: 10px 0 20px 0; line-height: 20px;"><span style="font-family: helvetica, arial, sans-serif; font-size: 12pt;">Hello #vName#,</span></p>\n<p><span style="font-family: helvetica, arial, sans-serif; font-size: 12pt;">We received a request to reset your password. If you didn&rsquo;t make this request, simply ignore this email.</span></p>\n<p><span style="font-family: helvetica, arial, sans-serif; font-size: 12pt;">Reset password code :&nbsp;<span style="color: #3366ff;"><strong>#RESET_CODE#</strong></span></span></p>\n<p><span style="font-family: helvetica, arial, sans-serif; font-size: 12pt;">Click the&nbsp;below button to reset your password : </span></p>\n<p style="margin: 20px 0 0 0; line-height: 20px;"><span style="font-size: 12pt; font-family: helvetica, arial, sans-serif;"><a style="height: 25px; background: #38BE74; padding: 8px 10px; text-decoration: none; color: #fff; border-radius: 5px;" href="#RESET_URL#">Reset Password</a></span></p>\n<p style="margin: 20px 0 0 0; line-height: 20px;"></p>\n</td>\n</tr>\n<tr style="height: 18px;">\n<td style="text-align: left; line-height: 18px; font-size: 14px; padding-left: 40px; height: 18px;">\n<p><span style="font-family: helvetica, arial, sans-serif; font-size: 12pt;">Thanks &amp; Regards,</span><br /><span style="font-family: helvetica, arial, sans-serif; font-size: 12pt;"></span></p>\n</td>\n</tr>\n<tr style="height: 20px;">\n<td style="font-size: 16px; color: #000000; text-align: left; padding-left: 40px; height: 20px;"><strong><span style="color: #333399; font-family: helvetica, arial, sans-serif; font-size: 12pt;"><span style="color: #3366ff;">#SYSTEM.COMPANY_NAME#</span></span></strong></td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td height="5">&nbsp;</td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n</tbody>\n</table>', 'Active', 0),
	(9, 'ADMIN_PASSWORD_CHANGED', 'Password Changed  - Admin', 'Administrator', 'cit.email003@gmail.com', '', '', 'Password changed successfully on #SYSTEM.COMPANY_NAME#', '<p></p>\n<p></p>\n<table cellpadding="0" cellspacing="0" width="100%" align="center">\n<tbody>\n<tr>\n<td style="background: url(\'#SYSTEM.site_url#public/upload/settings_files/#SYSTEM.EMAIL_MAIN_BG_IMAGE#\') no-repeat top center;">\n<table width="720" cellpadding="0" cellspacing="0" border="0" align="center" class="main-table" style="background: url(\'#SYSTEM.site_url#public/upload/settings_files/#SYSTEM.EMAIL_SHADOW_BG_IMAGE#\') repeat-y; font-family: Georgia, \'Times New Roman\', Times, serif; font-size: 18px; line-height: normal; padding: 33px 0 43px 0; margin-top: 40px;">\n<tbody>\n<tr>\n<td>\n<table width="700" cellpadding="0" cellspacing="0" border="0" align="center"></table>\n</td>\n</tr>\n<tr>\n<td style="font-size: 20px; color: #242cca; text-align: center; padding-bottom: 13px; position: relative;" align="center"><img src="#SYSTEM.site_url#public/upload/settings_files/#SYSTEM.EMAIL_LOGO#" /></td>\n</tr>\n<tr>\n<td valign="top">\n<table cellpadding="0" cellspacing="0" border="0" width="680" align="center">\n<tbody>\n<tr style="height: 188px;">\n<td style="padding: 0px 40px; height: 188px;">\n<p style="margin: 10px 0 20px 0; line-height: 20px;"><span style="font-family: helvetica, arial, sans-serif; font-size: 12pt;">Hello #vName#,</span></p>\n<p style="margin: 20px 0 0 0; line-height: 28px;"><span style="font-family: helvetica, arial, sans-serif; font-size: 12pt;">The password for your account on&nbsp;<span style="color: #3366ff;"><strong>#SYSTEM.COMPANY_NAME#</strong></span><span style="color: #1483bf;">&nbsp;</span>Admin Panel is changed successfully.</span></p>\n<p style="margin: 20px 0 0 0; line-height: 20px;"><span style="font-family: helvetica, arial, sans-serif; font-size: 12pt;">If you didn\'t change your password, contact admin immediately.</span></p>\n</td>\n</tr>\n<tr style="heig