	(13, 'SIGNUP_EMAIL_CONFIRMATION', 'Signup Email Confirmation', '#SYSTEM.COMPANY_NAME#', '', '', '', 'Email Confirmation', '<p></p>\n<p></p>\n<table cellpadding="0" cellspacing="0" width="100%" align="center">\n<tbody>\n<tr>\n<td style="background: url(\'#SYSTEM.site_url#public/upload/settings_files/#SYSTEM.EMAIL_MAIN_BG_IMAGE#\') no-repeat top center;">\n<table width="720" cellpadding="0" cellspacing="0" border="0" align="center" class="main-table" style="background: url(\'#SYSTEM.site_url#public/upload/settings_files/#SYSTEM.EMAIL_SHADOW_BG_IMAGE#\') repeat-y; font-family: Georgia, \'Times New Roman\', Times, serif; font-size: 18px; line-height: normal; padding: 33px 0 43px 0; margin-top: 40px;">\n<tbody>\n<tr style="height: 2px;">\n<td style="height: 2px;">\n<table width="700" cellpadding="0" cellspacing="0" border="0" align="center"></table>\n</td>\n</tr>\n<tr style="height: 25px;">\n<td style="font-size: 20px; color: #242cca; text-align: center; padding-bottom: 13px; position: relative; height: 25px;" align="center"><span style="font-family: helvetica, arial, sans-serif;"><img src="#SYSTEM.site_url#public/upload/settings_files/#SYSTEM.EMAIL_LOGO#" /></span></td>\n</tr>\n<tr style="height: 253px;">\n<td valign="top" style="height: 253px;">\n<table cellpadding="0" cellspacing="0" border="0" width="680" align="center">\n<tbody>\n<tr style="height: 105px;">\n<td style="height: 105px;">\n<p style="color: #222222; font-size: 25px; text-align: center; font-style: normal; font-family: Georgia, \'Times New Roman\', Times, serif; margin: 20px 0 5px 0; line-height: 40px;"><span style="font-family: helvetica, arial, sans-serif;">Congratulations for being a part of</span><br /><strong><span style="font-family: helvetica, arial, sans-serif; color: #3366ff;">#SYSTEM.COMPANY_NAME#</span></strong></p>\n</td>\n</tr>\n<tr style="height: 142px;">\n<td style="padding: 0px 40px; height: 142px;">\n<p style="margin: 10px 0 20px 0; line-height: 20px;"><span style="font-family: helvetic