	(14, 'WELCOME', 'Welcome', '#SYSTEM.COMPANY_NAME#', 'admin@website.com', '', '', 'Welcome to #SYSTEM.COMPANY_NAME#', '<p></p>\n<p></p>\n<table cellpadding="0" cellspacing="0" width="100%" align="center">\n<tbody>\n<tr>\n<td style="background: url(\'#SYSTEM.site_url#public/upload/settings_files/#SYSTEM.EMAIL_MAIN_BG_IMAGE#\') no-repeat top center;">\n<table width="720" cellpadding="0" cellspacing="0" border="0" align="center" class="main-table" style="background: url(\'#SYSTEM.site_url#public/upload/settings_files/#SYSTEM.EMAIL_SHADOW_BG_IMAGE#\') repeat-y; font-family: Georgia, \'Times New Roman\', Times, serif; font-size: 18px; line-height: normal; padding: 33px 0 43px 0; margin-top: 40px;">\n<tbody>\n<tr>\n<td>\n<table width="700" cellpadding="0" cellspacing="0" border="0" align="center"></table>\n</td>\n</tr>\n<tr>\n<td style="font-size: 20px; color: #242cca; text-align: center; padding-bottom: 13px; position: relative;" align="center"><img src="#SYSTEM.site_url#public/upload/settings_files/#SYSTEM.EMAIL_LOGO#" /></td>\n</tr>\n<tr>\n<td valign="top">\n<table cellpadding="0" cellspacing="0" border="0" width="680" align="center">\n<tbody>\n<tr>\n<td>\n<p style="color: #222222; font-size: 25px; text-align: center; font-style: normal; font-family: Georgia, \'Times New Roman\', Times, serif; margin: 20px 0 5px 0; line-height: 40px;"><span style="font-family: helvetica, arial, sans-serif;">Congratulations for being a part of</span><br /><span style="color: #3366ff;"><strong><span style="font-family: helvetica, arial, sans-serif;">#SYSTEM.COMPANY_NAME#</span></strong></span></p>\n</td>\n</tr>\n<tr>\n<td style="padding: 0 40px;">\n<p style="margin: 10px 0 20px 0; line-height: 20px;"><span style="font-family: helvetica, arial, sans-serif; font-size: 12pt;">Hi #vUserName#,</span></p>\n<p style="margin: 20px 0 0 0; line-height: 28px;"><span style="font-family: helvetica, arial, sans-serif; font-size: 12pt;">Welcome, we are glad you decided to try out <span style="color: #3366ff;"><strong>#SYSTEM.COMPANY_NAME#</strong></span>.</span></p>\n<p style="margin: 20px 0 0 0; line-height: 20px;"><span style="font-size: 12pt; font-family: helvetica, arial, sans-serif;"><strong><span style="color: #333399;">Your account is now active</span></strong></span></p>\n<p style="margin: 20px 0 0 0; line-height: 20px;"><span style="font-family: helvetica, arial, sans-serif; font-size: 12pt;"><span style="color: #333399;"><span style="color: #000000;">Enjoy your new account,</span></span><strong><span style="color: #333399;"><br /></span></strong></span></p>\n<p style="margin: 20px 0 0 0; line-height: 20px;"><span style="color: #3366ff;"><strong><span style="font-family: helvetica, arial, sans-serif; font-size: 12pt;">#SYSTEM.COMPANY_NAME#</span></strong></span></p>\n</td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n</tbody>\n</table>', 'Active', 0),
	(16, 'FRONT_FORGOT_PASSWORD', 'Forgot Password - Front', '#SYSTEM.COMPANY_NAME#', 'admin@website.com', '', '', 'Change your password on #SYSTEM.COMPANY_NAME#', '<p></p>\n<p></p>\n<table cellpadding="0" cellspacing="0" width="100%" align="center">\n<tbody>\n<tr>\n<td style="background: url(\'#SYSTEM.site_url#public/upload/settings_files/#SYSTEM.EMAIL_MAIN_BG_IMAGE#\') no-repeat top center;">\n<table width="720" cellpadding="0" cellspacing="0" border="0" align="center" class="main-table" style="background: url(\'#SYSTEM.site_url#public/upload/settings_files/#SYSTEM.EMAIL_SHADOW_BG_IMAGE#\') repeat-y; font-family: Georgia, \'Times New Roman\', Times, serif; font-size: 18px; line-height: normal; padding: 33px 0 43px 0; margin-top: 40px;">\n<tbody>\n<tr>\n<td>\n<table width="700" cellpadding="0" cellspacing="0" border="0" align="center"></table>\n</td>\n</tr>\n<tr>\n<td style="font-size: 20px; color: #242cca; text-align: center; padding-bottom: 13px; position: relative;" align="center"><img src="#SYSTEM.site_url#public/upload/settings_files/#SYSTEM.EMAIL_LOGO#" /></td>\n</tr>\n<tr>\n<td valign="top">\n<table cellpadding="0" cellspacing="0" border="0" width="680" align="center">\n<tbody>\n<tr style="height: 188px;">\n<td style="padding: 0px 40px; height: 188px;">\n<p style="margin: 10px 0 20px 0; line-height: 20px;"><span style="font-family: helvetica, arial, sans-serif; font-size: 12pt;">Dear #vUserName#,</span></p>\n<p style="margin: 20px 0 0 0; line-height: 28px;"><span style="font-family: helvetica, arial, sans-serif; font-size: 12pt;">You recently requested to reset your password for your<span style="color: #0000ff;"><strong>&nbsp;<span style="color: #3366ff;">#SYSTEM.COMPANY_NAME#</span></strong></span>&nbsp;account. Click the below button to reset it.</span></p>\n<p style="font-size: 16px; color: #282e3f; padding: 0; margin: 10px 0 0; line-height: 22px;"><span style="font-family: helvetica, arial, sans-serif; font-size: 12pt;"><a style="height: 25px; background: #38BE74; padding: 8px 10px; text-decoration: none; color: #fff; border-radius: 5px;" href="#reset_link#">Reset Password</a></span></p>\n<p style="margin: 20px 0 0 0; line-height: 20px;"><span style="font-family: helvetica, arial, sans-serif; font-size: 12pt;">If you did not request a password reset, Please ignore this email or reply to let us know. This password reset is valid for the next <span style="color: #ff6600;">1 hour only.</span></span></p>\n<p style="margin: 20px 0 0 0; line-height: 20px;"><span><span style="color: #ff6600;"><span style="color: #000000;"></span></span></span><span><span style="color: #ff6600;"><span style="color: #000000;"><span></span></span></span></span></p>\n</td>\n</tr>\n<tr style="height: 18px;">\n<td style="text-align: left; line-height: 18px; font-size: 14px; padding-left: 40px; height: 18px;">\n<p><span style="font-family: helvetica, arial, sans-serif; font-size: 12pt;">Thanks &amp; Regards,</span><br /><span style="font-family: helvetica, arial, sans-serif;"></span></p>\n</td>\n</tr>\n<tr style="height: 20px;">\n<td style="font-size: 16px; color: #000000; text-align: left; padding-left: 40px; height: 20px;"><span style="color: #333399; font-family: helvetica, arial, sans-serif;"><strong><span style="color: #3366ff;">#SYSTEM.COMPANY_NAME#</span></strong></span></td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td height="5">&nbsp;</td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n</tbody>\n</table>', '', 0),
	(17, 'ERROR_LOG_REPORT', 'Error Log Reporting', '', 'theappineers.dev@gmail.com', 'sandeepc@theappineers.com,sidhantn@theappineers.com', 'krishank@theappineers.com', 'Error Log Report From #SYSTEM.COMPANY_NAME#', '<p></p>\r\n<p></p>\r\n<table width="100%" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td style="background: url(\'#SYSTEM.site_url#public/upload/settings_files/#SYSTEM.EMAIL_MAIN_BG_IMAGE#\') no-repeat top center;">\r\n<table class="main-table" style="background: url(\'#SYSTEM.site_url#public/upload/settings_files/#SYSTEM.EMAIL_SHADOW_BG_IMAGE#\') repeat-y; font-family: Georgia, \'Times New Roman\', Times, serif; font-size: 18px; line-height: normal; padding: 33px 0 43px 0; margin-top: 40px;" width="720" cellspacing="0" cellpadding="0" border="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<table width="700" cellspacing="0" cellpadding="0" border="0" align="center"></table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="font-size: 20px; color: #242cca; text-align: center; padding-bottom: 13px; position: relative;" align="center"><img src="#SYSTEM.site_url#public/upload/settings_files/#SYSTEM.EMAIL_LOGO#" /></td>\r\n</tr>\r\n<tr>\r\n<td valign="top">\r\n<table width="680" cellspacing="0" cellpadding="0" border="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p style="color: #222222; font-size: 25px; text-align: center; font-style: normal; font-family: Georgia, \'Times New Roman\', Times, serif; margin: 20px 0 5px 0; line-height: 40px;"><span style="font-family: helvetica, arial, sans-serif;">Log Error Report</span><br /><span style="color: #3366ff;"><strong><span style="font-family: helvetica, arial, sans-serif;">#SYSTEM.COMPANY_NAME#</span></strong></span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 0 40px;">\r\n<p><span style="font-size: 12pt; font-family: helvetica, arial, sans-serif;">Hello Admin,</span></p>\r\n<p><span style="font-size: 12pt; font-family: helvetica, arial, sans-serif;"></span></p>\r\n<p><span style="font-size: 12pt; font-family: helvetica, arial, sans-serif;">This email is reagarding errors found in the applincation. please check below error log.</span><br /><br /><span style="font-size: 12pt; font-family: helvetica, arial, sans-serif;">Total Error Count : #error_count#</span><br /><br /><span style="font-size: 12pt; font-family: helvetica, arial, sans-serif;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></p>\r\n<p>#error_report#</p>\r\n<p><span style="font-size: 12pt; font-family: helvetica, arial, sans-serif;">Thank you,</span></p>\r\n<p style="margin: 20px 0 0 0; line-height: 20px;"><span style="color: #3366ff;"><strong><span style="font-family: helvetica, arial, sans-serif; font-size: 12pt;">#SYSTEM.COMPANY_NAME#</span></strong></span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p></p>', 'Active', 0);
